import React from 'react'

export default function News() {
  const messages = [
    { id: "001", name: "张三", mse: "1" },
    { id: "002", name: "李四", mse: "2" },
    { id: "003", name: "王五", mse: "3" },
  ]
  return (
    <div>
      <ul>
        {
          messages.map((m) => {
            return <li key={m.id}>
              <></>
            </li>
          })
        }
      </ul>
    </div>
  )
}
